INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(1, 'Iron Maiden', 'https://twitter.com/IronMaiden', 'https://www.facebook.com/ironmaiden', , 'Iron Maiden are an English heavy metal band formed in Leyton, east London, in 1975 by bassist and primary songwriter Steve Harris. The band''s discography has grown to thirty-seven albums, including fifteen studio albums, eleven live albums, four EPs, and seven compilations.\r\nPioneers of the New Wave of British Heavy Metal, Iron Maiden achieved initial success during the early 1980s. After several line-up changes, the band went on to release a series of US and UK platinum and gold albums, including 1982''s The Number of the Beast, 1983''s Piece of Mind, 1984''s Powerslave, 1985''s live release Live After Death, 1986''s Somewhere in Time and 1988''s Seventh Son of a Seventh Son. Since the return of lead vocalist Bruce Dickinson and guitarist Adrian Smith in 1999, the band have undergone a resurgence in popularity, with their latest studio offering, The Final Frontier, peaking at No. 1 in 28 different countries and receiving widespread critical acclaim.');
INSERT INTO `band` (`ID`, `Name`, `Twitter`, `Facebook`, `Picture`, `Description`) VALUES
(2, 'Sabaton', 'https://twitter.com/sabaton', 'https://www.facebook.com/sabaton', , 'Sabaton [?saba?ton] are a heavy metal band from Falun, Sweden formed in 1999. The band''s main lyrical themes are based on war and historical battles. This is heard in albums Primo Victoria, Attero Dominatus and Coat of Arms where all of the songs, except final tracks. Lyrical content drawn from World War I, World War II and other conflicts is prevalent and includes songs about battles and leaders on all sides of said conflicts.\r\n\r\nIn April 2012 four members left the band and formed another, whilst vocalist Joakim Brodn and bassist Pr Sundstrm continued with new members. As well as extensively touring internationally the band have a festival in their home town of Falun, Sabaton Open Air, in August and an annual cruise, ''Sabaton Cruise'', in November.');

